Foucault, Derrida, Crenshaw, hooks, Barthes, Butler all emerged from the Marxist tradition.  They redirected that tradition from its original concern with the working class toward cultural topics such as gender, language, race, and identity.

Cultural Marxism is a massive and arguably hegemonic presence within the intellectual and institutional life of our society.

@DeSantisWarRoom / @RonDeSantis is right to speak of its influence, which is both large and malign.
